>Our template supports three menu types:</p>\r\n<ul>\r\n<li>GK menu</li>\r\n<li>Dropline menu</li>\r\n<li>Split menu</li>\r\n</ul>\r\n<p>Each of these menus has different characteristic. It is important to know that in order to gain an additional functionality offered by \"GK menu\", a user has to install a plug-in which can be found in the rest-files package of a particular template.</p>','',1,0,0,8,'2011-01-13 00:12:59',42,'','2011-01-13 00:14:18',0,0,'0000-00-00 00:00:00','2011-01-13 00:12:59','0000-00-00 00:00:00','','','{\"show_title\":\"\",\"link_titles\":\"\",\"show_intro\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"alternative_readmore\":\"\",\"article_layout\":\"\"}',1,0,0,'','',1,95,'{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}',0,'*',''),(18,52,'Module variations','module-variations','','<p>On this page you can see basic suffixes used in this template. Please remember about using space at beginning of suffix name in module options!</p>\r\n<p>Most of the suffixes can be used only on the <strong>mainbody</strong>, <strong>mainbody_top</strong>, <strong>mainbody_bottom</strong> or<strong>sidebar</strong>module positions.</p>\r\n<p>The <strong>top1</strong>, <strong>top2</strong>, <strong>bottom1</strong>, <strong>bottom2</strong>, <strong>bottom3</strong> module positions have dedicated styling of the modules. On the <strong>top1</strong> or <strong>top2</strong> module positions we recommend to use also <strong>\" alpha\"</strong> suffix.</p>\r\n<p>The <strong>clear</strong> suffix is very useful to create banners or images without additional borders, margins and paddings. The clear suffix is also very useful inside the <strong>mainbody</strong>, <strong>mainbody_top</strong> and <strong>mainbody_bottom</strong> module positions.</p>\r\n<p>On the <strong>bottom2</strong> module position for the image banners we recommend to use the <strong>\" banner\"</strong> suffix - it will center the image and remove additional spacing.</p>\r\n<p>The News Show Pro module has additional suffixes: <strong>centernav</strong> - which creates a bottom centered pagination and <strong>zoom</strong> - which adds the hover effect for the images - look at the \"Latest Offers\" module.</p>\r\n<p>Additionaly there are two page suffixes: <strong>nobg</strong> and <strong>lightbg</strong>. First suffix is used to remove background from the mainbody, the second is used to change the position of the lighter background (it is useful to move the lighter background lower on the specific pages).</p>','',1,0,0,7,'2011-01-13 12:30:01',42,'','2012-07-05 10:27:04',42,0,'0000-00-00 00:00:00','2011-01-13 12:30:01','0000-00-00 00:00:00','{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}','{\"urla\":null,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":null,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":null,\"urlctext\":\"\",\"targetc\":\"\"}','{\"show_title\":\"\",\"link_titles\":\"\",\"show_intro\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"0\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_layout\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_bac