uthor\":\"0\",\"link_author\":\"0\",\"show_create_date\":\"0\",\"show_modify_date\":\"0\",\"show_publish_date\":\"0\",\"show_item_navigation\":\"0\",\"show_icons\":\"0\",\"show_print_icon\":\"0\",\"show_email_icon\":\"0\",\"show_vote\":\"\",\"show_hits\":\"0\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_layout\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}',9,0,1,'','',1,144,'{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}',0,'*',''),(70,150,'Parallax engine','parallax-engine','','<p>The Creative template supports our brand new parallax engine which allows you to create awesome parallax effects in the template headers.</p>\r\n<p>The usage of this engine needs basic knowledge in HTML5 and CSS. To create your own parallax effect, you need to do three things:</p>\r\n<ol>\r\n<li>create the necessary images (please remember about images for tablet and mobile devices)</li>\r\n<li>create the proper HTML5 code</li>\r\n<li>create the proper CSS code for the parallax effect elements.</li>\r\n</ol>\r\n<p>Let\'s start with the HTML5 code - the basic structure with one animated element seems as listed below:</p>\r\n<pre>&lt;div class=\"gk-parallax\" data-area=\"200\" data-height=\"400\"&gt;\r\n	&lt;div class=\"gk-parallax-wrap\"&gt;\r\n		&lt;div class=\"gkp-element gkp-circle\" data-start=\"50%,50%\" data-end=\"50%,100%\"&gt;Circle&lt;/div&gt;\r\n		&lt;div class=\"gkp-element gkp-square\" data-start=\"25%,25%\" data-end=\"75%,25%\"&gt;Square&lt;/div&gt;\r\n	&lt;/div&gt;\r\n	&lt;div class=\"gkp-tablet\"&gt;Tablet view&lt;/div&gt;\r\n	&lt;div class=\"gkp-mobile\"&gt;Mobile view&lt;/div&gt;\r\n&lt;/div&gt;\r\n</pre>\r\n<p>As we can see, the main wrapper contains two <strong>data-*</strong> attributes:</p>\r\n<ul>\r\n<li><strong>data-area</strong>- it is a value in pixels which specifies when the animation starts. 0 means that the animation will start when the top edge of the header is at the top of the browser window. E.g. 400 means that the animation will start when the top edge of the header is 400 pixels from the top of the browser window.</li>\r\n<li><strong>data-height</strong> - it is a height of the area which is necessary for us in pixels</li>\r\n</ul>\r\n<p>The main container contains three other wrappers:</p>\r\n<ul>\r\n<li><strong>gk-parallax-wrap</strong> - it contains animated elements</li>\r\n<li><strong>gkp-tablet</strong> - it should be styled to contain the image for the tablet devices (please remember to set the height value for this wrapper)</li>\r\n<li><strong>gkp-mobile</strong> - it should be styled to contain the image for the mobile devices (please remember to set the height value for this wrapper)</li>\r\n</ul>\r\n<p>And now the most interesting part - animated elements - every animated element should be placed in the <strong>gk-parallax-wrap</strong> container and have <strong>gkp-element</strong> class. Additionally, you will probably need to add also own class like <strong>gkp-circle</strong> or <strong>gkp-square</strong>.</p>\r\n<p>Every animated element contains two <strong>data-*</strong> attributes:</p>\r\n<ul>\r\n<li><strong>data-start</strong> - the start position coordinates (as percent values)</li>\r\n<li><strong>data-end</strong> - the end position coordinates (as percent values)</li>\r\n</ul>\r\n<p>Please remember that the coordinates are calculated relatively to the center of the object!</p>\r\n<p>So in the mentioned code, the circle will go to down of the parallax area and the square will go to the right side:</p>\r\n<div class=\"gk-parallax\" data-area=\"200\" data-height=\"400\">\r\n<div class=\"gk-parallax-wrap\">\r\n<div class=\"gkp-element gkp-circle\" data-start=\"50%,50%\" data-end=\"50%,100%\">Circle</div>\r\n<div class=\"gkp-element gkp-square\" data-start=\"25%,25%\" data-end=\"75%,25%\">Square</div>\r\n</div>\r\n<div class=\"gkp-tablet\">Tablet view</div>\r\n<div class=\"gkp-mobile\">Mobile view</div>\r\n</div>\r\n<p>A few useful information:</p>\r\n<ol>\r\n<li>You can use negative values to hide the element at the beginning of the animation</li>\r\n<li>The order of the elements in the wrapper is very important - the last element will be at the top of the stack of layers</li>\r\n<li>To get the background image, we recommend to add the own class for the gk-parallax container and use this class with the loaded class, i.e.:\r\n<pre>.loaded.gkp-background-top</pre>\r\nthen, the background image will appear after page loading completes.</li>\r\n</ol>','',1,0,0,7,'2012-08-01 09:00:48',42,'','2012-08-01 09:08:35',42,0,'0000-00-00 00:00:00','2012-08-01 09:00:48','0000-00-00 00:00:00','{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}','{\"urla\":null,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":null,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":null,\"urlctext\":\"\",\"targetc\":\"\"}','{\"show_title\":\"\",\"link_titles\":\"\",\"show_intro\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_layout\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}',3,0,0,'','',1,17,'{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}',0,'*',''),(71,151,'Creative - WebDesign Joomla! Template','creative-webdesign-joomla-template','','<p>Donec sed odio dui. Etiam porta sem ma