div>\r\n<h3>Additional typography elements</h3>\r\n<h4>Header banner</h4>\r\n<p>It is created with using proper H2 element:</p>\r\n<pre>&lt;h2 class=\"gkBannerHeader\"&gt;Welcome to Business Portfolio Website&lt;small&gt;Let\'s take a tour and you\'ll love this theme&lt;/small&gt;&lt;/h2&gt;</pre>\r\n<h2 class=\"gkBannerHeader\">Welcome to Business Portfolio Website<small>Let\'s take a tour and you\'ll love this theme</small></h2>\r\n<h4>Banner with button</h4>\r\n<p>It is a simple container with the link button:</p>\r\n<pre>&lt;div class=\"gkBannerWithButton\"&gt;Learn more before you use our products! &lt;a href=\"#\"&gt;Take a Tour&lt;/a&gt;&lt;/div&gt;</pre>\r\n<div class=\"gkBannerWithButton\">Learn more before you use our products! <a href=\"#\">Take a Tour</a></div>\r\n<h4>Testimonial</h4>\r\n<p>Blockquote element with additional styling for the cite element:</p>\r\n<pre>&lt;blockquote class=\"gkTestimonial\"&gt;&lt;p&gt;Thank you for the great customer service! I appreciated that you had someone to help me, even though it was 2:45 a.m. where I am.&lt;/p&gt;&lt;cite&gt;- Robert Gavick&lt;/cite&gt;&lt;/blockquote&gt;</pre>\r\n<blockquote class=\"gkTestimonial\">\r\n<p>Thank you for the great customer service! I appreciated that you had someone to help me, even though it was 2:45 a.m. where I am.</p>\r\n<cite>- Robert Gavick</cite></blockquote>\r\n<h4>Social icons</h4>\r\n<p>A set of 6 social icons:</p>\r\n<pre>&lt;a class=\"gkIconFacebook\" href=\"#\"&gt;Facebook&lt;/a&gt; \r\n&lt;a class=\"gkIconTwitter\" href=\"#\"&gt;Twitter&lt;/a&gt; \r\n&lt;a class=\"gkIconGplus\" href=\"#\"&gt;Google+&lt;/a&gt; \r\n&lt;a class=\"gkIconRSS\" href=\"#\"&gt;RSS&lt;/a&gt;\r\n&lt;a class=\"gkIconDribbble\" href=\"#\"&gt;Dribbble&lt;/a&gt; \r\n&lt;a class=\"gkIconVimeo\" href=\"#\"&gt;Vimeo&lt;/a&gt;\r\n</pre>\r\n<p><a class=\"gkIconFacebook\" href=\"#\">Facebook</a> <a class=\"gkIconTwitter\" href=\"#\">Twitter</a> <a class=\"gkIconGplus\" href=\"#\">Google+</a> <a class=\"gk