>mainbody_bottom</strong> or<strong>sidebar</strong>module positions.</p>\r\n<p>The <strong>top1</strong>, <strong>top2</strong>, <strong>bottom1</strong>, <strong>bottom2</strong>, <strong>bottom3</strong> module positions have dedicated styling of the modules. On the <strong>top1</strong> or <strong>top2</strong> module positions we recommend to use also <strong>\" alpha\"</strong> suffix.</p>\r\n<p>The <strong>clear</strong> suffix is very useful to create banners or images without additional borders, margins and paddings. The clear suffix is also very useful inside the <strong>mainbody</strong>, <strong>mainbody_top</strong> and <strong>mainbody_bottom</strong> module positions.</p>\r\n<p>On the <strong>bottom2</strong> module position for the image banners we recommend to use the <strong>\" banner\"</strong> suffix - it will center the image and remove additional spacing.</p>\r\n<p>The News Show Pro module has additional suffixes: <strong>centernav</strong> - which creates a bottom centered pagination and <strong>zoom</strong> - which adds the hover effect for the images - look at the \"Latest Offers\" module.</p>\r\n<p>Additionaly there are two page suffixes: <strong>nobg</strong> and <strong>lightbg</strong>. First suffix is used to remove background from the mainbody, the second is used to change the position of the lighter background (it is useful to move the lighter background lower on the specific pages).</p>\";s:4:\"body\";s:0:\"\";s:5:\"catid\";s:1:\"7\";s:10:\"created_by\";s:2:\"42\";s:16:\"created_by_alias\";s:0:\"\";s:8:\"modified\";s:19:\"2012-07-05 10:27:04\";s:11:\"modified_by\";s:2:\"42\";s:6:\"params\";O:9:\"JRegistry\":1:{s:7:\"\0*\0data\";O:8:\"stdClass\":67:{s:14:\"article_layout\";s:9:\"_:default\";s:10:\"show_title\";s:1:\"1\";s:11:\"link_titles\";s:1:\"1\";s:10:\"show_intro\";s:1:\"1\";s:13:\"show_category\";s:1:\"1\";s:13:\"link_category\";s:1:\"1\";s:20:\"show_parent_category\";s:1:\"0\";s:20:\"link_parent_category\";s:1:\"0\";s:11:\"sho